import java.io.FileWriter;
import java.io.IOException;

public class BinaryXOR {

	public static void main(String[] args) throws IOException {
		// TODO Auto-generated method stub
		
		// write file
		FileWriter writer = new FileWriter("C:\\Users\\olivi\\Desktop\\FFHS\\11 Semester\\RNG\\Whitening\\randomorgXOR.txt", true);
		
		String s1 ="";

		// combine
		int jump = 0;

		long start2 = System.nanoTime();
		// create two halves
		String s2 = s1.substring(0,s1.length()/2-1);
		String s3 = s1.substring(s1.length()/2+1,s1.length());
		
		while(jump < s2.length()) {
		String s4 = s2.substring(0+jump,1+jump);
		String s5= s3.substring(0+jump,1+jump);
	
		if ((s4.equals("0")) && (s5.equals("0"))) {
			writer.write("0"); 
		}
		else if ((s4.equals("1")) && (s5.equals("1"))) { 
			writer.write("0"); 
		}
		else if ((s4.equals("1")) && (s5.equals("0"))) {
			writer.write("1"); 
			
		}
		else if  ((s4.equals("0")) && (s5.equals("1"))){
			writer.write("1"); 		
		}
		else {};
			jump = jump+1;
		}
		long end2 = System.nanoTime();
		long nanoseconds = (end2 - start2);
		System.out.println("Elapsed time in nanoseconds : "+ nanoseconds +" ns");
		System.out.println("Length of bitstring : " + s1.length()/2);
		writer.close();
		
	}

}
